&lt;p style="margin-left: 0.25in"&gt;
	&lt;strong&gt;Problem Description:&lt;/strong&gt; Cumulative composite damage in composite pressure vessels (CPVs) currently is not monitored on-orbit. Consequently, hazards due to catastrophic burst before leak (BBL) or compromised CPV reliability cannot be ascertained or mitigated, posing a risk to crew and mission assurance. The energy associated with CPV rupture can be significant, especially with high pressure gases are under containment, and the energy releases can be severe enough to cause injury, death, loss of assets or mission.&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;
&lt;p style="margin-left: 0.25in"&gt;
	&lt;strong&gt;Dual-Use Rationale:&lt;/strong&gt; CPVs similar to those used by NASA on ISS, for example, are finding increasing use in automotive and transportation industry applications. These CPVs generally have a nonload sharing liner and are repeatedly filled over their service lifetime, typically with hydrogen or compressed natural gas (CNG). The same structural health monitoring equipment and software developed by NASA WSTF for evaluating, in real-time, the health of NASA CPVs on ISS will be used to evaluate the health of automotive CPVs, the only differences being the type and design of the CPV, and the in-service lifetime pressure histories.&lt;/p&gt;
&lt;p&gt;
	&amp;nbsp;&lt;/p&gt;
&lt;p style="margin-left: 0.25in"&gt;
